(54, 14, '{\"en\":{\"avatar\":{\"type\":\"img\",\"value\":\"general\\/images\\/wtNA0K1qztJNNtvnFGaX.jpg\",\"class\":\"col-md-12\"},\"name\":{\"type\":\"text\",\"value\":\"Kawser Ahmed\",\"class\":\"col-md-6\"},\"work_at\":{\"type\":\"text\",\"value\":\"Web Designer\",\"class\":\"col-md-6\"},\"facebook_profile\":{\"type\":\"text\",\"value\":\"#\",\"class\":\"col-md-6\",\"trans\":false},\"instagram_profile\":{\"type\":\"text\",\"value\":\"#\",\"class\":\"col-md-6\",\"trans\":false},\"linkedin_profile\":{\"type\":\"text\",\"value\":\"#\",\"class\":\"col-md-6\",\"trans\":false},\"pinterest_profile\":{\"type\":\"text\",\"value\":\"#\",\"class\":\"col-md-6\",\"trans\":false},\"info_title\":{\"type\":\"text\",\"value\":\"About Me\",\"class\":\"col-md-12\"},\"info\":{\"type\":\"textarea\",\"value\":\"This good man possesses qualities that inspire us all. He is selfless, always putting the needs of others before his own. Whether it\'s helping a neighbor in distress, volunteering at local charities, or simply lending a listening ear to those who need it, he consistently demonstrates the true meaning of altruism.\\r\\n\\r\\nThis good man is a source of unwavering support and encouragement to those around him. He is a pillar of strength in times of adversity and a wellspring of joy in times of celebration.\",\"class\":\"col-md-12\"},\"skill_1\":{\"type\":\"text\",\"value\":\"IT Management\",\"class\":\"col-md-6\"},\"skill_experience_1\":{\"type\":\"text\",\"value\":\"80\",\"class\":\"col-md-6\"},\"skill_2\":{\"type\":\"text\",\"value\":\"Web Development\",\"class\":\"col-md-6\"},\"skill_experience_2\":{\"type\":\"text\",\"value\":\"60\",\"class\":\"col-md-6\"},\"skill_3\":{\"type\":\"text\",\"value\":\"Network Security\",\"class\":\"col-md-6\"},\"skill_experience_3\":{\"type\":\"text\",\"value\":\"90\",\"class\":\"col-md-6\"},\"skill_4\":{\"type\":\"text\",\"value\":\"Platform Integration\",\"class\":\"col-md-6\"},\"skill_experience_4\":{\"type\":\"text\",\"value\":\"95\",\"class\":\"col-md-6\"},\"description_title\":{\"type\":\"text\",\"value\":\"Education Background\",\"class\":\"col-md-12\"},\"description\":{\"type\":\"rich_text\",\"value\":\"<h4><span class=\\\"primary-color text-capitalize mb-3\\\">Bachelor\'s Degree<\\/span>, 2010<\\/h4>\\r\\n\\r\\n<p style=\\\"font-size:16px;color:rgb(88,88,88);\\\">Proin ultricies ultricies est vitae cursus. Nulla sit amet suscipit tortor. Maecenas dui erat, ornare eget tristique vitae, rutrum pretium justo. Phasellus vitae consequat nisi, quis luctus nisl. Praesent faucibus sem id massa semper ornare. Nam eu magna at mi pellentesque mattis. Morbi at condimentum velit. Phasellus aliquet, leo auctor volutpat ultrices, metus dolor dictum enim, sed convallis lacus urna nec erat.<\\/p>\\r\\n\\r\\n<h4><span class=\\\"primary-color text-capitalize mb-3 mt-5\\\">Master\'s Degree In Design<\\/span>, 2015<\\/h4>\\r\\n\\r\\n<p style=\\\"font-size:16px;color:rgb(88,88,88);\\\">Proin ultricies ultricies est vitae cursus. Nulla sit amet suscipit tortor. Maecenas dui erat, ornare eget tristique vitae, rutrum pretium justo. Phasellus vitae consequat nisi, quis luctus nisl. Praesent faucibus sem id massa semper ornare. Nam eu magna at mi pellentesque mattis. Morbi at condimentum velit. Phasellus aliquet, leo auctor volutpat ultrices, metus dolor dictum enim, sed convallis lacus urna nec erat.<\\/p>\",\"class\":\"col-md-12\"}},\"es\":{\"name\":{\"type\":\"text\",\"value\":\"Kawser Ahmed\",\"class\":\"col-md-6\"},\"work_at\":{\"type\":\"text\",\"value\":\"Dise\\u00f1adora web\",\"class\":\"col-md-6\"},\"info_title\":{\"type\":\"text\",\"value\":\"Acerca de m\\u00ed\",\"class\":\"col-md-12\"},\"info\":{\"type\":\"textarea\",\"value\":\"Este buen hombre posee cualidades que nos inspiran a todos. Es desinteresado y siempre antepone las necesidades de los dem\\u00e1s a las suyas propias. Ya sea ayudando a un vecino en apuros, siendo voluntario en organizaciones ben\\u00e9ficas locales o simplemente escuchando a quienes