es lo necesitan, \\u00e9l demuestra constantemente el verdadero significado del altruismo.\\r\\n\\r\\nEste buen hombre es una fuente de apoyo y aliento inquebrantable para quienes lo rodean. \\u00c9l es un pilar de fortaleza en tiempos de adversidad y una fuente de alegr\\u00eda en tiempos de celebraci\\u00f3n.\",\"class\":\"col-md-12\"},\"skill_1\":{\"type\":\"text\",\"value\":\"Gesti\\u00f3n de TI\",\"class\":\"col-md-6\"},\"skill_experience_1\":{\"type\":\"text\",\"value\":\"80\",\"class\":\"col-md-6\"},\"skill_2\":{\"type\":\"text\",\"value\":\"Desarrollo web\",\"class\":\"col-md-6\"},\"skill_experience_2\":{\"type\":\"text\",\"value\":\"60\",\"class\":\"col-md-6\"},\"skill_3\":{\"type\":\"text\",\"value\":\"Seguridad de la red\",\"class\":\"col-md-6\"},\"skill_experience_3\":{\"type\":\"text\",\"value\":\"90\",\"class\":\"col-md-6\"},\"skill_4\":{\"type\":\"text\",\"value\":\"Integraci\\u00f3n de plataforma\",\"class\":\"col-md-6\"},\"skill_experience_4\":{\"type\":\"text\",\"value\":\"95\",\"class\":\"col-md-6\"},\"description_title\":{\"type\":\"text\",\"value\":\"Antecedentes educacionales\",\"class\":\"col-md-12\"},\"description\":{\"type\":\"rich_text\",\"value\":\"<h4><span>Licenciatura, 2010<\\/span><br><\\/h4>\\r\\n\\r\\n<p style=\\\"font-size:16px;color:rgb(88,88,88);\\\">Despu\\u00e9s de todo, es el curso de la vida. No es necesario tomar la temperatura. Era el Mecenas del dios, necesita adornar su triste vida, su maquillaje vale el precio. Si no, \\u00bfqui\\u00e9n llora el fin de la vida? Siempre queda delicioso adornar la ensalada con la masa. De hecho, es genial para mis hijos. Quiere estar enfermo y enfermo. La flota de barcos, el autor de la carrera, el miedo al dolor se dec\\u00eda, pero no hab\\u00eda urna del lago del valle.<\\/p>\\r\\n\\r\\n<h4><span>Maestr\\u00eda en Dise\\u00f1o, 2015<\\/span><br><\\/h4>\\r\\n\\r\\n<p style=\\\"font-size:16px;color:rgb(88,88,88);\\\">Despu\\u00e9s de todo, es el curso de la vida. No es necesario tomar la t