ollow these linking terms and conditions.<\\/p>\\r\\n\\r\\n<h3><br><\\/h3>\\r\\n\\r\\n<h3>Removal of links from our website<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">If you find any link on our Website that is offensive for any reason, you are free to contact and inform us any moment. We will consider requests to remove links but we are not obligated to or so or to respond to you directly.<\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">We do not ensure that the information on this website is correct, we do not warrant its completeness or accuracy; nor do we promise to ensure that the website remains available or that the material on the website is kept up to date.<\\/p>\\r\\n\\r\\n<h3><br><\\/h3>\\r\\n\\r\\n<h3>Disclaimer<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">To the maximum extent permitted by applicable law, we exclude all representations, warranties and conditions relating to our website and the use of this website. Nothing in this disclaimer will:<\\/p>\\r\\n\\r\\n<ul><li>limit or exclude our or your liability for death or personal injury;<\\/li><li>limit or exclude our or your liability for fraud or fraudulent misrepresentation;<\\/li><li>limit any of our or your liabilities in any way that is not permitted under applicable law; or<\\/li><li>exclude any of our or your liabilities that may not be excluded under applicable law.<\\/li><\\/ul>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">The limitations and prohibitions of liability set in this Section and elsewhere in this disclaimer: (a) are subject to the preceding paragraph; and (b) govern all liabilities arising under the disclaimer, including liabilities arising in contract, in tort and for breach of statutory duty.<\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">As long as the website and the information and services on the website are provided free of charge, we will not be liable for any loss or damage of any nature.<\\/p>\",\"es\":\"<h2>T\\u00e9rminos y condiciones<\\/h2>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">\\u00a1Bienvenido al nombre del sitio web!<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Estos t\\u00e9rminos y condiciones describen las reglas y regulaciones para el uso del sitio web de Company Name, ubicado en Website.com.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Al acceder a este sitio web asumimos que acepta estos t\\u00e9rminos y condiciones. No contin\\u00fae utilizando el nombre del sitio web si no acepta todos los t\\u00e9rminos y condiciones establecidos en esta p\\u00e1gina.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">La siguiente terminolog\\u00eda se aplica a estos T\\u00e9rminos y condiciones, Declaraci\\u00f3n de privacidad y Aviso de exenci\\u00f3n de responsabilidad y a todos los Acuerdos: \\\"Cliente\\\", \\\"Usted\\\" y \\\"Su\\\" se refieren a usted, la persona que inicia sesi\\u00f3n en este sitio web y cumple con los t\\u00e9rminos y condiciones de la Compa\\u00f1\\u00eda. \\u201cLa Compa\\u00f1\\u00eda\\u201d, \\u201cNosotros\\u201d, \\u201cNosotros\\u201d, \\u201cNuestro\\u201d y \\u201cNos\\u201d, se refiere a nuestra Compa\\u00f1\\u00eda. \\u201cParte\\u201d, \\u201cPartes\\u201d o \\u201cNosotros\\u201d se refieren tanto al Cliente como a nosotros mismos. Todos los t\\u00e9rminos se refieren a la oferta, aceptaci\\u00f3n y consideraci\\u00f3n del pago necesario para llevar a cabo el proceso de nuestra asistencia al Cliente de la manera m\\u00e1s adecuada con el prop\\u00f3sito expreso de satisfacer las necesidades del Cliente con respecto a la prestaci\\u00f3n de los servicios indicados por la Compa\\u00f1\\u00eda, de acuerdo con y sujeto a la legislaci\\u00f3n vigente en los Pa\\u00edses Bajos. Cualquier uso de la terminolog\\u00eda anterior u otras palabras en singular, plural, may\\u00fasculas y\\/o \\u00e9l\\/ella o ellos, se consideran intercambiables y por lo tanto se refieren a las mismas.<\\/p>\\r\\n\\r\\n<h3><br><\\/h3>\\r\\n\\r\\n<h3>Galletas<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Empleamos el uso de cookies. Al acceder al Nombre del sitio web, acepta utilizar cookies de acuerdo con la Pol\\u00edtica de privacidad del Nombre de la empresa.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">La mayor\\u00eda de los sitios web interactivos utilizan cookies para permitirnos recuperar los detalles del usuario en cada visita. Nuestro sitio web utiliza cookies para habilitar la funcionalidad de ciertas \\u00e1reas para que sea m\\u00e1s f\\u00e1cil para las personas que visitan nuestro sitio web. Algunos de nuestros socios afiliados\\/publicitarios tambi\\u00e9n pueden utilizar cookies.<\\/p>\\r\\n\\r\\n<h3><br><\\/h3>\\r\\n\\r\\n<h3>Licencia<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">A menos que se indique lo contrario, Nombre de la empresa y\\/o sus licenciantes poseen los derechos de propiedad intelectual de todo el material en Nombre del sitio web. Todos los derechos de propiedad intelectual est\\u00e1n reservados. Puede acceder a esto desde Nombre del sitio web para su uso personal sujeto a las restricciones establecidas en estos t\\u00e9rminos y condiciones.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">No debes:<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Volver a publicar material desde el nombre del sitio web<\\/p>\\r\\n\\r\\n<p style=\\\"t