val of the linking party and its products and\\/or services; and (c) fits within the context of the linking party\'s site.<\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">We may consider and approve other link requests from the following types of organizations:<\\/p>\\r\\n\\r\\n<ul><li>commonly-known consumer and\\/or business information sources;<\\/li><li>dot.com community sites;<\\/li><li>associations or other groups representing charities;<\\/li><li>online directory distributors;<\\/li><li>internet portals;<\\/li><li>accounting, law and consulting firms; and<\\/li><li>educational institutions and trade associations.<\\/li><\\/ul>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">We will approve link requests from these organizations if we decide that: (a) the link would not make us look unfavorably to ourselves or to our accredited businesses; (b) the organization does not have any negative records with us; (c) the benefit to us from the visibility of the hyperlink compensates the absence of\\u00a0<span class=\\\"highlight preview_company_name\\\">Company Name<\\/span>; and (d) the link is in the context of general resource information.<\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">These organizations may link to our home page so long as the link: (a) is not in any way deceptive; (b) does not falsely imply sponsorship, endorsement or approval of the linking party and its products or services; and (c) fits within the context of the linking party\'s site.<\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">If you are one of the organizations listed in paragraph 2 above and are interested in linking to our website, you must inform us by sending an e-mail to\\u00a0<span class=\\\"highlight preview_company_name\\\">Company Name<\\/span>. Please include your name, your organization name, contact information as well as the URL of your site, a list of any URLs from which you intend to link to our 