;text-align:justify;\\\">Nos reservamos el derecho de solicitarle que elimine todos los enlaces o cualquier enlace en particular a nuestro sitio web. Usted aprueba eliminar inmediatamente todos los enlaces a nuestro sitio web si as\\u00ed lo solicita. Tambi\\u00e9n nos reservamos el derecho de modificar estos t\\u00e9rminos y condiciones y su pol\\u00edtica de vinculaci\\u00f3n en cualquier momento. Al vincularse continuamente a nuestro sitio web, usted acepta estar sujeto y seguir estos t\\u00e9rminos y condiciones de vinculaci\\u00f3n.<\\/p>\\r\\n\\r\\n<h3><br><\\/h3>\\r\\n\\r\\n<h3>Eliminaci\\u00f3n de enlaces de nuestro sitio web<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Si encuentra alg\\u00fan enlace en nuestro sitio web que sea ofensivo por cualquier motivo, puede contactarnos e informarnos en cualquier momento. Consideraremos las solicitudes para eliminar enlaces, pero no estamos obligados a hacerlo ni a responderle directamente.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">No garantizamos que la informaci\\u00f3n de este sitio web sea correcta, no garantizamos su integridad o exactitud; Tampoco prometemos garantizar que el sitio web permanezca disponible o que el material del sitio web se mantenga actualizado.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<h3>Descargo de responsabilidad<\\/h3>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"font-size:16px;text-align:justify;\\\">En la medida m\\u00e1xima permitida por la ley aplicable, excluimos todas las representaciones, garant\\u00edas y condiciones relacionadas con nuestro sitio web y el uso de este sitio web. Nada en este descargo de responsabilidad:<\\/p>\\r\\n\\r\\n<ul><li>limitar o excluir nuestra o su responsabilidad por muerte o lesiones personales;<\\/li><li>limitar o excluir nuestra o su responsabilidad por fraude o tergiversaci\\u00f3n fraudulenta;<\\/li><li>limitar cualquiera de nuestras responsabilidades o las suyas de cualquier forma que no est\\u00e9 permitida por la ley aplicable; o<\\/li><li>excluir cualquiera de nuestras responsabilidades o las suyas que no puedan estar excluidas seg\\u00fan la ley aplicable.<\\/li><\\/ul>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Las limitaciones y prohibiciones de responsabilidad establecidas en esta Secci\\u00f3n y en otras partes de este descargo de responsabilidad: (a) est\\u00e1n sujetas al p\\u00e1rrafo anterior; y (b) regir todas las responsabilidades que surjan bajo la exenci\\u00f3n de responsabilidad, incluidas las responsabilidades que surjan en el contrato, en agravio y por incumplimiento del deber legal.<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\"><br><\\/p>\\r\\n\\r\\n<p style=\\\"text-align:justify;\\\">Siempre que el sitio web y la informaci\\u00f3n y los servicios del sitio web se proporcionen de forma gratuita, no seremos responsables de ninguna p\\u00e9rdida o da\\u00f1o de cualquier naturaleza.<\\/p>\"}', 'dynamic', NULL, 1, '1', 60, 'general/images/LE19XfA9e7mHDuhN69gH.jpg', '2024-04-24 22:48:50', '2024-05-14 21:31:39'),
